import Head from "next/head";
import Navbar from "./Navbar";

const Layout = (props) => (
    <div>
        <Head>
            <title>Mini Football App</title>
            <link
                rel="stylesheet"
                href="https://bootswatch.com/4/cerulean/bootstrap.min.css"/>
            <link
                rel="stylesheet"
                href="web/css/app.css"/>
        </Head>
        <Navbar/>
        <div className="container">
            {props.children}
        </div>
    </div>
);
export default Layout;
